  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1998 calendar
  year. The report begins by summarizing Refuge highlights and climatic conditions
  during the year. Planning details the management plan, compliance with environmental
  and cultural resource mandates, and research and investigations. Administration
  is discussed; topics include personnel, youth programs, other manpower programs,
  volunteer programs, funding, safety, and technical assistance. Habitat management
  is discussed; topics include wetlands, croplands, grasslands, other habitats, grazing,
  haying, fire management, pest control, and water rights. Wildlife- including wildlife
  diversity, endangered and threatened species, waterfowl, marsh and water birds,
  shorebirds, raptors, other migratory birds, game mammals, other resident wildlife,
  fisheries resources, wildlife propagation and stocking, animal control, marking
  and banding, and disease prevention and control- is also covered. The public uses
  section discusses outdoor classrooms, information and interpretation, hunting, fishing,
  trapping, wildlife observation, other wildlife oriented recreation, camping, picnicking,
  and law enforcement. The equipment and facilities section discusses new construction,
  rehabilitation, major maintenance, equipment utilization and replacement, communications
  systems, and computer systems. Cooperative programs, items of interest, Refuge brochures,
  and photographs are attached. Narratives for Arrowwood Wetland Management District
  and Johnson Lake National Wildlife Refuge is also included.\",\n\t\"owner_org\":
